[[Air vice-marshal|Air Vice Marshal]] '''Garry Tunnicliffe''' is a senior [[Royal Air Force]] officer who serves as [[Defence Services Secretary]].

==RAF career==
Educated at [[Devonport High School for Boys]],<ref>{{cite web|url=http://www.plymouthherald.co.uk/devonport-air-cadets-welcome-cadet/story-18642810-detail/story.html|title=Devonport air cadets welcome back former cadet|publisher=Plymouth Herald|date=8 April 2013|accessdate=22 July 2016}}</ref> Tunnicliffe joined the Royal Air Force on 14 August 1988.<ref>{{LondonGazette|issue=51504|supp=yes|startpage=11638|date=17 October 1988|accessdate=21 July 2016}}</ref> He became head of the RAF's Team of Management Consultants in 2006, station commander at [[RAF Halton]] in December 2008<ref>{{cite web|url=http://www.raf.mod.uk/news/archive.cfm?storyid=16A9D111-1143-EC82-2EEC1E6FF2C87CB5|title=New boss at the home of recruit training|publisher=Royal Air Force|date=8 December 2008|accessdate=22 July 2016}}</ref> and Assistant Chief of Staff, Training at [[No. 22 Group RAF|No. 22 Group]] in December 2012.<ref>{{cite web|url=http://www.gulabin.com/armynavy/pdf/Royal%20Air%20Force%20Senior%20Appointments.pdf|title=Senior Royal Air Force appointments|accessdate=22 July 2016}}</ref> He went on to be Head of Remuneration at the [[Ministry of Defence (United Kingdom)|Ministry of Defence]] in 2014<ref>{{cite web|url=https://www.gov.uk/government/uploads/system/uploads/attachment_data/file/530077/158thCACMeetingMinuties_16-July-2014.pdf|title=Central advisory committee on pensions and compensation|publisher=Ministry of Defence|date=16 July 2014|accessdate=22 July 2016}}</ref> and [[Defence Services Secretary]] on 27 June 2016.<ref>Air Appointments, Daily Telegraph, 21 July 2016</ref><ref>{{LondonGazette|issue= 61656|supp=yes|startpage=16088|date=26 July 2016|accessdate=26 July 2016}}</ref>

